import React from "react";
import { TextField } from "@material-ui/core";

export default function Input(props) {
  const { name, label, value, onChange } = props;
  return (
    <TextField
      variant="outlined"
      label={label}
      name={name}
      value={values}
      onChange={onChange}
      InputLabelProps={{ shrink: true }}
    />
  );
}
